import React from "react";
<App />
import movies from "../movies"
import Movie from "./Movie"
import Nav from "./Nav"

function Createlist(list){
    return (
        <Movie 
        title={list.title}
        poster={list.poster}
        genre={list.genre}
        />
    )
}
function App(){
  
    return (
        
        <div>
        <Nav />
          <dl className="dictionary">{movies.map(Createlist)}</dl>
        </div>
    )
}

export default App
